import ExpenseItems from "./components/expenseItems";

function App() {
  const expense = [
    {
      title: "Car insurance",
      date: new Date(2021, 5, 27),
      amount: 356.6,
    },
    {
      title: "Lg UHD",
      date: new Date(2021, 6, 3),
      amount: 233,
    },
    {
      title: "Car insurance",
      date: new Date(2021, 0, 20),
      amount: 356.6,
    },
  ];
  return (
    <div>
      <h1>Let's get started!</h1>
      <ExpenseItems
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItems>
      <ExpenseItems
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItems>
      <ExpenseItems
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      ></ExpenseItems>
    </div>
  );
}

export default App;
